import { defineService, implementService } from '@wix/services-definitions';
import { SignalsServiceDefinition, } from '@wix/services-definitions/core-services/signals';
export const ScheduleItemTagServiceDefinition = defineService('scheduleItemTag');
export const ScheduleItemTagService = implementService.withConfig()(ScheduleItemTagServiceDefinition, ({ getService, config }) => {
    const signalsService = getService(SignalsServiceDefinition);
    const tag = signalsService.signal(config.tag);
    return { tag };
});
